&lt;h1 align="center"&gt; Interpretations of the Model &lt;/h1&gt;
&lt;BR&gt;

&lt;ul&gt;
  &lt;li&gt;With the addition of 1 flight, the arrival delay increases by 0.009 minutes.&lt;/li&gt;
  &lt;li&gt;When the number of flights is 0, the estimated delay is -302.583 minutes.&lt;/li&gt;
  &lt;li&gt;The p-value of &lt;0.0009 indicates that the relationship between the number of flights and the minutes a flight is delayed is significant.&lt;/li&gt;
  &lt;li&gt;The R-squared value of 0.677 indicates that approximately 67.7% of the variation in the arrival delay can be explained by the number of flights.&lt;/li&gt;
  &lt;li&gt;Overall, the number of flights has a statistically significant effect on the arrival delay.&lt;/li&gt;
&lt;/ul&gt;

&lt;h1 align="center"&gt; Interpretations of the ANOVA Model &lt;/h1&gt;
&lt;BR&gt;

&lt;ul&gt;The number of flights has a significant impact on the arrival delay, shown by the low p-value of &lt; 2.2e-16.&lt;/li&gt;
  &lt;li&gt;The higher the F-statistic the better the fit.  With an F-statistic of 7,538.2, there is a strong overall fit of the model.&lt;/li&gt;
  &lt;li&gt;The mean square value of 276 indicates the average variability not accounted for by the model.&lt;/li&gt;
  &lt;li&gt;The mean square value of 2,077,915 suggest a large amount of variability is explained by the number of flights.&lt;/li&gt;
  &lt;li&gt;Overall, the number of flights significantly influences arrival delay.&lt;/li&gt;
&lt;/ul&gt;
